import React from 'react';

import './Gans.css';

function Gans() {
  return (
    <div className="App">
      <header className="App-header">
        <p className="breadcrumb"><code><span class="cyan">Articles</span> &gt; <span class="cyan">GANs</span></code></p>
      </header>
    </div>
  );
}
export default Gans;
